import React from 'react';
import { StickyContainer, Sticky } from 'react-sticky';

class ContactSticky extends React.Component {
    render() {
        return (
            <StickyContainer>
                <Sticky>
                    {({
                        style,
                        isSticky,
                        wasSticky,
                        distanceFromTop,
                        distanceFromBottom,
                        calculatedHeight
                    }) => (
                    <header style={style}>
                        Contact
                    </header>
                    )}
                </Sticky>
            </StickyContainer>
        );
    }
};

export default ContactSticky;
